import { useQuery, gql } from '@apollo/client';
import StaffSection from './../components/StaffSection';
import React, { PureComponent } from 'react';

import {
    LineChart,
    Line,
    XAxis,
    YAxis,
    CartesianGrid,
    Tooltip,
    Legend,
    ReferenceLine,
    ResponsiveContainer,
  } from 'recharts';
  


  const data_chart_foot_fall = [
    {
      name: 'Jan',
      amt: 2400,
    },
    {
      name: 'Feb',
      amt: 2210,
    },
    {
      name: 'March',
      amt: 2290,
    },
    {
      name: 'Apr',
      amt: 2000,
    },
    {
      name: 'May',  
      amt: 2181,
    },
    {
      name: 'Jun', 
      amt: 2500,
    },
    {
      name: 'Jul', 
      amt: 2100,
    },
  ];


const STAFF_QUERY = gql`
{
    staff {
      id
      staff_name
      efficiency_d1
      efficiency_d2
      nps_d1
      nps_d2
      efficiency
      reported_Issues
      location {
        id
        location
      }
    }
  }  
`;
const VisualsGraphs = () => {
const { data } = useQuery(STAFF_QUERY);
const  data_staff = data;





console.log(data_staff);
 return (   
    <div class="row">
    <div class="col-lg-6 col-12">
        <div class="card">
            <div class="card-header d-flex justify-content-between align-items-end">
                <h4>Foot fall</h4>
              
            </div>
            <div class="card-content">
                <div class="card-body pt-0">                
                    <LineChart
                            width={500}
                            height={300}
                            data={data_chart_foot_fall}
                            margin={{
                                top: 20,
                                right: 50,
                                left: 20,
                                bottom: 5,
                            }}
                            >
                            <CartesianGrid strokeDasharray="6 3" />
                            <XAxis dataKey="name" />
                            <YAxis />
                            <Tooltip />
                            <Legend />
                            <ReferenceLine x="Page C" stroke="red" label="Max PV PAGE" />
                            <ReferenceLine y={9800} label="Max" stroke="red" />
                            <Line type="monotone" dataKey="amt" stroke="#8884d8" />
                   
                    </LineChart>
                                      
                </div>
            </div>
        </div>
    </div>

    <div class="col-lg-6 col-12">
        <div class="card">
            <div class="card-header d-flex justify-content-between pb-0">
                <h4 class="card-title">Graph 2</h4>                                  
            </div>
            <div class="card-content">
                <div class="card-body py-0">
                    <div id="customer-chart"></div>
                </div>                             
            </div>
        </div>
    </div>














    <div class="col-lg-12 col-md-6 col-12">
                <div class="card">











         <div class="card-content">
          <div class="card-body table-responsive">
            <table class="table text-center m-0">
              <thead>
                <tr>
                  <th>No</th>
                  <th>Staff Name</th>
                  <th>Efficiency Delta</th>
                  <th>NPS Delta</th>
                  <th>Efficiency</th>
                  <th>Reported Issues</th>             
                </tr>
              </thead>            
              {data_staff && (
                    <tbody>
                    {data_staff.staff.map((dbObject) => (
                        <StaffSection key={dbObject.id} dbObject={dbObject} />
                    ))}
                    </tbody>
                )} 
            </table>
          </div>
        </div>




     </div>
    </div>
</div>
);
};
//gg

export default VisualsGraphs;
